import React from 'react';
import { FeaturedCollectionBanner, HomeViewAbout, HomeViewHeader, HomeViewProductSlider } from 'config/C4';

const HomeView = () => {
  return (
    <div className="homeView">
      <HomeViewHeader />
      <HomeViewAbout />
      <FeaturedCollectionBanner />
      <HomeViewProductSlider />
    </div>
  )
}

export default HomeView;
